function cargarDibujo() {
  marco = document.getElementById('dibujo');
  contexto = marco.getContext('2d');

  var img = new Image();
  img.src = "data:image/png;base64,";

  img.onload = function () {
    contexto.drawImage(img, 0, 0);
  }
}

